import React from "react";
import '../styles/headers/Header.css';

function Header() {
    return (
        <ul>
            <li className="headerElement">Профиль</li>
            <li className="headerElement">Календарь</li>
            <li className="headerElement">Сохраненные файлы</li>
            <li className="headerElement">О нас</li>       
        </ul>
    )
}

export default Header;
